script: |
  super -f text -I q4954.spq | sort > q4954.out

inputs:
  - name: q4954.spq
    data: |
      SELECT DISTINCT - col1 + + col2 * - col0, col0 FROM tab0 (FORMAT parquet) AS cor0 WHERE NOT CAST ( NULL AS INTEGER ) * + - col2 * + - col0 IN ( col2 * + col0 + 70 / - 57 + + col2 + 3, + 54 + + 33 );
  - name: tab0

outputs:
  - name: q4954.out
    data: |
